import React from 'react';

const Footer = () => (
    <footer className="text-center center-block bg-light">
        <a href="https://www.github.com/"><i className="fa fa-github fa-2x social"></i></a>&nbsp;&nbsp;&nbsp;&nbsp;
        <a href="https://stackoverflow.com/"><i className="fa fa-stack-overflow fa-2x social"></i></a>&nbsp;&nbsp;&nbsp;&nbsp;
        <a href="https://linkedin.com/"><i className="fa fa-linkedin-square fa-2x social"></i></a>
    </footer> 
);

export default Footer;
